Ext.data.JsonP['Hyperloop_1.2.8_Release_Note']({"guide":"<?xml version=\"1.0\" encoding=\"UTF-8\" ?>\n<!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\"\n        \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\">\n<html xmlns=\"http://www.w3.org/1999/xhtml\">\n<head>\n    <title>Hyperloop 1.2.8 - 18 October 2016</title>\n\n    <meta http-equiv=\"Content-Type\" content=\"text/html; charset=UTF-8\">\n    <meta content=\"Scroll EclipseHelp Exporter\" name=\"generator\">\n\n    <link type=\"text/css\" rel=\"stylesheet\">\n    <link type=\"text/css\" rel=\"stylesheet\">\n    <link type=\"text/css\" rel=\"stylesheet\" media=\"print\">\n</link></link></link></meta></meta></head>\n<body>\n    <div class=\"container\">\n\t\t<div id=\"banner\" class=\"confbox admonition admonition-note aui-message warning shadowed information-macro\">\n\t\t\t<p>You can now find Appcelerator documentation at <a href=\"https://docs.axway.com/\" target=\"_blank\">https://docs.axway.com/</a>. This site will be taken down in the near future.</p></div>\n        <div class=\"header\"/>\n\n        <div id=\"src-48431456\" class=\"content\">\n                        <h1>Hyperloop 1.2.8 - 18 October 2016</h1>\n    <p>Hyperloop 1.2.8 is a patch release that includes several bug fixes.    </p>\n    <p>This version only supports up to Titanium SDK 5.5.1. Use Hyperloop 2.0.0 and newer for Titanium SDK 6.0.0 and newer.    </p>\n    <div class=\"section section-2 \" id=\"src-48431456_Hyperloop1.2.8ReleaseNote-Fixedissues\">\n        <h2 class=\"heading \"><span>Fixed issues</span></h2>\n<ul class=\" \"><li class=\" \">    <p><a class=\"external-link external-link\" href=\"https://jira.appcelerator.org/browse/TIMOB-23808\" target=\"_blank\">TIMOB-23808</a> - Hyperloop: iOS - Example application not building with Xcode 8 because of Swift-Error    </p>\n</li><li class=\" \">    <p><a class=\"external-link external-link\" href=\"https://jira.appcelerator.org/browse/TIMOB-23953\" target=\"_blank\">TIMOB-23953</a> - Hyperloop: Android - Fails to cast Ti.Android.Intent to native Android Intent    </p>\n</li><li class=\" \">    <p><a class=\"external-link external-link\" href=\"https://jira.appcelerator.org/browse/TIMOB-23926\" target=\"_blank\">TIMOB-23926</a> - Hyperloop: Improve Ti SDK handling during CI builds    </p>\n</li></ul>    </div>\n        </div><a id=\"editButton\" href=\"https://wiki.appcelerator.org/pages/editpage.action?pageId=48431456\"><span>Edit</span></a>\n    \n        \n    </div>\n</body>\n</html>\n","title":"Hyperloop 1.2.8 Release Note"});